function Home(props) {
  const dispatch=useDispatch();
  useEffect(()=>{
    dispatch(actionCreators.loadCarts())
  })
  console.log(props.cartQuantity);
  return (
    <div>
        <Navbar/>
        <Grid/> 
    </div>
  )
}

export default Home
